import React, { Component } from "react";

class SignInForm extends Component {
    render() {
    return (
        <div>
            <div>
                <label>Email</label>
              <input 
                type = "Email"
                placeholder = "Enter The Valid Email"
                name = "Email"
            />
            </div>
            <div>
            <input 
                type = "password"
                placeholder = "Enter The password"
                name = "password"
            />
            </div>
        </div>
    )
    }


}
export default SignInForm;
